import "./MiOrg.css"
import {useState} from "react"

const MiOrg =()=>{
  
  const manejarClic =(event)=>{
    event.useState()
  }
  
  return <section className="orgSection">
    <h3 className="title">Mi Organización</h3>
    <img src="/img/Botão add-01 1.png" alt="add" onClick={manejarClic}/>
  </section>
}

export default MiOrg
